                        <div class="sqs-block-content">
                            <h1 style="white-space: pre-wrap;"><strong>Rosenh√∏j Student Housing</strong></h1>
                        </div>
                    </div>
                    <div class="sqs-block spacer-block sqs-block-spacer sized vsize-1" data-block-type="21"
                         id="block-ee6735572059e8004259">
                        <div class="sqs-block-content">&nbsp;</div>
                    </div>
                    <div class="sqs-block html-block sqs-block-html" data-block-type="2" id="block-b1c600ab74dd474db4cb">
                        <div class="sqs-block-content">
                            <p style="white-space: pre-wrap;">Rosenh√∏j Student Housing is the latest design in the transformation of
                                Rosenh√∏j neighbourhood in Viby Syd, Aarhus, DK.</p>
                            <p style="white-space: pre-wrap;"> Following the successful and sustainable transformation of Rosenh√∏j
                                social housing area, the new student housing will provide a new attractive and welcoming accommodation
                                for the youth of Aarhus, Denmark¬¥s city with the highest concentration of students. </p>
                            <p style="white-space: pre-wrap;"> The proximity to the existing Light Rail train station ensures that
                                Aarhus city centre can be reached in 5 minutes only, making Rosenh√∏j Student Housing a convenient
                                choice for the students of both the nearby Business Academy Aarhus and the other Universities and
                                Academies.</p>
                            <p style="white-space: pre-wrap;">&nbsp;Originally inspired by the existing nearby building blocks, the
                                sinuous curvy shape of the building creates an inviting lush outdoor space, sheltered from the
                                trafficked roads and optimized following the morphology of the site. The stepping roof terraces will
                                grant undisturbed views to the existing surrounding building.</p>
                            <p style="white-space: pre-wrap;">&nbsp;Developed over an overall surface of 3810 m2, the student
                                housing will feature 82 single bedroom accommodations and 4 double bedroom apartments, in addition to
                                spacious social spaces and various facilities such as shared kitchens, laundry rooms, roof terraces
                                and bike parking.</p>
                            <p style="white-space: pre-wrap;">&nbsp;The project is commissioned by the Aarhus Omegn. The completion
                                is expected at the end of 2019.</p>
                        </div>
